import React, { useState } from "react";
import Advertisements from "./Advertisements";
import Companies from "./Companies";
import Applications from "./Applications";
import Users from "./Users";

const NavBar = () => {
    const [currentPage, setCurrentPage] = useState("advertisements");

    const renderPage = () => {
        switch (currentPage) {
            case "advertisements":
                return <Advertisements />;
            case "companies":
                return <Companies />;
            case "applications":
                return <Applications />;
            case "users":
                return <Users />;
            default:
                return <Advertisements />;
        }
    };

    return (
        <div>
            <div>
                <button onClick={() => setCurrentPage("advertisements")}>
                    Advertisements
                </button>
                <button onClick={() => setCurrentPage("companies")}>
                    Companies
                </button>
                <button onClick={() => setCurrentPage("applications")}>
                    Applications
                </button>
                <button onClick={() => setCurrentPage("users")}>Users</button>
            </div>
            <div>{renderPage()}</div>
        </div>
    );
};

export default NavBar;
